var load = true
var pi_data = null
function load_file(aaa){
    load = true
    fetch("./" + aaa + ".json")
    .then(res => res.json())
    .then(data => {
        load = false
        pi_data = data
        aaaaaa = [makeRepeated(["&ensp;"],15),data.start].flat().slice(-15)
        document.getElementById("pi").innerHTML = aaaaaa.join("")
    })
}
